/**
 * @param {number[]} nums
 * @return {number}
 */
var continuousSubarrays = function(nums) {
    let count = 0;
    let windowStart = 0;

    for (let windowEnd = 0; windowEnd < nums.length; windowEnd++) {
        // Ensure the window is valid
        while (!isWindowValid(nums, windowStart, windowEnd)) {
            windowStart++; // Shrink the window from the start if it's not valid
        }
        // All subarrays ending at windowEnd and starting from windowStart to windowEnd are valid
        count += windowEnd - windowStart + 1;
    }

    return count;
};

/**
 * Check if the window is valid by ensuring the difference between any two numbers
 * in the window does not exceed 2.
 */
function isWindowValid(nums, start, end) {
    let max = nums[start];
    let min = nums[start];
    for (let i = start; i <= end; i++) {
        max = Math.max(max, nums[i]);
        min = Math.min(min, nums[i]);
        if (max - min > 2) {
            return false; // Window is not valid if the max-min difference is more than 2
        }
    }
    return true; // Window is valid
}
